class UserGreeting extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isLoggedIn: false,
    };
  }

        render() {
                if (this.state.isLoggedIn) {
                        return (
                          <div></div>
                  )
          }
    return (
      <div>
        <div>Welcome Sravan</div>
        <div>Welcome Kittu</div>
      </div>
    );
  }
}

export default UserGreeting;
